import { CardMedia, Paper } from "@mui/material";
import { Alert, Card, Container } from "react-bootstrap";
import { useNavigate } from "react-router";
const studentimg = new URL("../AllImages/student.jpeg", import.meta.url)
const teacherimg = new URL("../AllImages/teacher.jpeg", import.meta.url)
export function Home() {
    const navigate = useNavigate();
    return (
        <>
            <div className="mt-5">
             <Container>
                    <div className="mt-4">
                        <Paper elevation={2} className="d-flex justify-content-center" style={{ backgroundColor: "#f2f2f2" }}>
                            <Card className="p-2 m-4" style={{ maxWidth: "200px", backgroundColor: "#f2f2f2" }} onClick={() => navigate("/studentlist")}>
                                <CardMedia
                                    component="img"
                                    alt="Students"
                                    style={{
                                        height: "150px",
                                        width: "100%",
                                        objectFit: "cover",
                                    }}
                                    className="img-fluid"
                                    image={studentimg}
                                />
                                <div className="p-3">
                                    <h2 style={{ margin: 0 }} className="text-center" >Add Student</h2>
                                </div>
                            </Card>


                            <Card className="p-2 m-4" style={{ maxWidth: "200px", backgroundColor: "#f2f2f2" }} onClick={() => navigate("/studentlist")}>
                                <CardMedia
                                    component="img"
                                    alt="Teachers"
                                    style={{
                                        height: "150px",
                                        width: "100%",
                                        objectFit: "cover",
                                    }}
                                    className="img-fluid"
                                    image={teacherimg}
                                />
                                <div className="p-3">
                                    <h2 style={{ margin: 0 }} className="text-center">Add Teacher</h2>
                                </div>
                            </Card>

                            {/* <Card className="p-2 m-4" style={{ maxWidth: "200px", backgroundColor: "#f2f2f2" }} onClick={() => navigate("/teacherlist")}>
                                <CardMedia
                                    component="img"
                                    alt="Arrested Persons"
                                    style={{
                                        height: "150px",
                                        width: "100%",
                                        objectFit: "cover",
                                    }}
                                    className="img-fluid"
                                    image={domesticicons}
                                />
                                <div className="p-3">
                                    <h2 style={{ margin: 0 }} className="text-center">Domestic Helper No.</h2>
                                </div>
                            </Card> */}
                        </Paper>
                    </div>


                </Container>
            </div>
        </>
    )
}
